import React, { Component } from 'react';
import { Route, Switch, withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import ListData from './ListData/index';
import PostData from './PostData/index';
import EditData from './EditData/index';
import {ProtectedRoute} from '../../routes/ProtectedRoute';

class DataComponent extends Component {
    render() {
        return (
            <div className="dashboard-content-container">
                <Switch>
                    <Route exact path="/api/list-data" component={ListData} />
                    <Route path="/api/list-data" component={ListData} />
                    <Route path='/api/post-data' component={PostData} />
                    {/* <Route path="/api/list-data" component={ListData} />
                    <Route path="/api/post-data" component={PostData} />
                    <Route path="/api/edit-data" component={EditData} /> */}
                </Switch>
            </div>
        )
    }
}
function mapStateToProps(state) {
    const { toggleStatus } = state.appReducer;
    const { auth } = state.LoginReducer;
    return { toggleStatus, auth }
}

export default withRouter(connect(mapStateToProps)(DataComponent));
